import { NgModule } from '@angular/core';
import { UsersPage } from './users.page';
import {
  PhotosServiceModule,
  TestResolver,
  UserAlbumsStateModule,
  UsersListComponent,
  UsersServiceModule,
  UserStorageModule,
} from '@user-albums';
import { RouterModule } from '@angular/router';
import { UserDetailsPage } from './user-details.page';

const routes = [
  {
    path: '',
    component: UsersPage,
  },
  {
    path: `:userId`,
    component: UserDetailsPage,
    resolve: { a: TestResolver },
  },
];

@NgModule({
  imports: [
    UsersListComponent,
    UsersServiceModule,
    UserAlbumsStateModule,
    PhotosServiceModule,
    UserStorageModule,
    RouterModule.forChild(routes),
  ],
  declarations: [UsersPage, TestResolver],
  exports: [UsersPage],
})
export class UsersPageModule {}
